import React, { Component } from "react";

class Dropzone extends Component {
  render() {
    return (
      <p>
        <i className="fas fa-upload"></i>
        <input
          ref={this.fileInputRef}
          className="FileInput"
          type="file"
          multiple
          onChange={this.onFilesAdded}
        />
      </p>
    );
  }
}
export default Dropzone;
